    false,nt"url": null,nt"notes": "This narrative report for Aleutian Islands
    NWR and Izembek Bay Area outlines Refuge accomplishments from January through April
    of 1955. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes Refuge visitors.",nt"license_title": "License Not
